import React from 'react';
import './App.css';

function App() {
  return (
    <div className="content">
      <img src="./img/chat.png" alt="chat" className="chatPng" />
      <header className="contentHeader align-c">
        <div className="headerLeft c-p align-c">
          <h4>Language</h4>
          <img src="./img/caret-down.png" alt="arrow down" className="arrowDown" />
        </div>
        <div className="headerRight align-c">
          <img width="20" src="./img/heart.svg" alt="hearth" className="heartSvg" />
          <div className="cartBlock">
          <img width="20" src="./img/cart.svg" alt="cart" className="cartSvg" />
          <span className="activatedCart"></span>
          </div>
          <img width="20" src="./img/history.svg" alt="history" className="historySvg" />
        </div>
      </header>
    </div>
  );
}

export default App;
